function Header() {
  return (
    <header>
        <nav>
            <ul className="header-links">
                <li className="header-button"><a href="">Home</a></li>
                <li className="header-button"><a>Predmeti</a></li>
                <li className="header-button"><a>Galerija</a></li>
                <li className="header-button"><a>Music Visualizer</a></li>
                <li className="header-button"><a>upcoming Testi</a></li>
                <li className="header-button change-to-light"><a>Light</a></li>
            </ul>
        </nav>
    </header>

  );
}

export default Header;
